  JWILLIAMS, Margaret Ellen and MACLEAN, Christopher Haydon
  IMACLEAN, Kenneth Edward and PALMER, Beatrice Daisy
  IMACLEAN, James Nelson (Jim) and WILLIAMS, Elizabeth Jean
  IMACLEAN, Timothy Williams and DRUMMOND, Pamela Anne
  MACLEAN. Timothy Williams and DRUMMOND, Pamela Anne (cont...)
  born. There Tim and Pam worked as a team building up their small farm and aiming for excellence in
  every aspect. They raised the lambing percentage, planted thousands of trees for both amenity and
  land conservation and produced wool from their Romney flock to rival the best in the district.
  They were both keen members of a land care group.
  Tim was innovative and imaginative. As a 'lay' geologist he became very knowledgeable about the
  land formation of the Waimarama district and the farm gave him ample scope to exercise his skills
  as a 'lay' engineer. He also enjoyed mountaineering, sailing, hang-gliding and travelling. He and
  Pam spent four years travelling the world together, working as they went, she as a nurse and he as
  a builder. They climbed in the Himalayas and dived in the Red Sea, living for a time in a Bedouin
  hut on the Sinai Peninsula. After a year in London, they went to the United States, then on to
  Southern India and Australia. There they spent a year in Brisbane and hitch-hiked across the
  Nullabor Plains from Perth to Adelaide. Tim learnt to sail a catamaran, later owning one of his
  own at Waimarama.
  Tim was a skilled musician, playing the guitar and harmonica (simultaneously), and had a great
  sense of humour. He and Pam both gave strong support to the Waimarama School where Tim was
  Chairman of the Board of Trustees until his accidental death on the farm. Since then Pam has coped
  with the sale of the farm and a move to Havelock North where she and the children are building a
  new life together. She is a registered nurse and is presently working for Healthcare Hawkes Bay.
  01> MACLEAN, Paul Timothy
  b 11.04.1983
  Paul b, at Hastings. He attends Havelock North High School and his interests include mountain
  biking, motocross, tennis and guitar.
  02> MACLEAN, Kate Jean
  b 05.06.1985
  Kate b. at Hastings. She attends Havelock North Intermediate and her interests include violin,
  swimming and reading.
  03> MACLEAN, Samuel Thomas
  b 09.03.1989
  Samuel b. at Hastings. He attends Te Mata Primary School in Havelock North and his interests
  include soccer, swimming, nature and animals.
  04> MACLEAN, Peter Samuel m on 07.04.1984 to TYLEE, Ann Patricia (Ani)
  b 12.11.1956
  b 31.08.1958
  Peter b. at Hastings and m. at Pukehou. Ann, d/o Michael Tylee and Jane Nelson, b. at Hastings.
  Address: 132 Main Road, Clive, Hawkes Bay.
  Peter was educated at Pukehou School, Hereworth School and Wanganui Collegiate School (school
  prefect) and spent two years at Massey University. He is a self-taught craftsman in wood and in
  1996 he built his present workshop at Clive. He works part-time in the Art Department at Hawkes
  Bay Polytechnic as a tutor in wood and he is the recipient of two grants from the QEII Arts
  Council.
  Ani was educated at Woodford House and has a BA in Social Sciences. She has done further tertiary
  study in practical art, marketing and New Zealand arts. She is active in the Hawkes Bay arts
  community and in 1997 she started working as secretary of the H&W Williams Memorial Trust. Ani and
  Peter both belong to a discussion group covering current issues, ideas, literature and media.
  01> MACLEAN, Holly Frances Tylee
  b 17.09.1984
  Holly b. at Napier. Her interests are piano, art, hockey, canoe polo and tennis.
